import { Button } from "@mui/material";
import { useContext } from "react";
import ItemsContext from '../Store/ItemsContext.js';

const Footer = ({ switchPage, setSwitchPage }) => {
  const togglePage = useContext(ItemsContext);
  console.log("togglePage value:", togglePage);

  const handleToggleButton = () => {
    togglePage();
  }

  return (
    <div>
      <Button variant="contained" onClick={handleToggleButton}>  
        {togglePage ? "Users" : "Admin"}
      </Button>
    </div>
  )
}

export default Footer;
